function analyzeMorphology(word) {
    let morphs = {}
    let candidates = getLemmaCandidates(word);
    for (const candidate of candidates) {
        let stem = candidate[0];
        let eomi = candidate[1];
        if (!EOMIS.has(eomi)) {
            continue;
        }
        if (ADJECTIVES.has(stem)) {
            if (!(stem in morphs)) {
                morphs[stem] = [];
            }
            morphs[stem].push({
                stem: stem,
                eomi: eomi,
                pos: 'Adjective'
            })
        }
        if (VERBS.has(stem)) {
            if (!(stem in morphs)) {
                morphs[stem] = [];
            }
            morphs[stem].push({
                stem: stem,
                eomi: eomi,
                pos: 'Verb'
            })
        }
    }
    return morphs;
}


function getLemmaCandidates(word) {
    let candidates = []
    if (word.endsWith('습니다') && hasFinalConsonant(word.charAt(word.length - 4))) {
        candidates.push([word.substring(0, word.length - 3), '습니다']);
    }
    for (let i = 0; i < word.length; ++i) {
        let c = word.charAt(i);
        let l = word.substring(0, i + 1);
        let r = word.substring(i + 1)
        let l_ = word.substring(0, i);
        candidates.push([l, r])

        if (c in RULES) {
            let rules = RULES[c];
            for (const rule of rules) {
                candidates.push([l_ + rule.stem, rule.eomi + r]);
            }
        }

        if (i + 2 <= word.length) {
            let conj = word.substring(i, i + 2);
            if (conj in RULES) {
                let rules = RULES[conj];
                for (const rule of rules) {
                    candidates.push([l_ + rule.stem, rule.eomi + r.substring(1)]);
                }
            }
        }

        if (i + 3 <= word.length) {
            let conj = word.substring(i, i + 3);
            if (conj in RULES) {
                let rules = RULES[conj];
                for (const rule of rules) {
                    candidates.push([l_ + rule.stem, rule.eomi + r.substring(2)]);
                }
            }
        }
    }
    console.log(candidates)
    return candidates;
}

function lastVowel(word) {
    if (word.length > 0) {
        return decompose(word.charAt(word.length - 1)).vowel;
    }
    return '';
}

function filterMorphs(morphs) {
    let trueMorphs = []
    for (const stem in morphs) {
        for (const morph of morphs[stem]) {
            console.log(morph)
            switch (morph.eomi) {
                case '아':
                    if (/[ㅏㅑㅗㅛㅘ]/.test(lastVowel(stem))) {
                        trueMorphs.push(morph)
                    }
                    if (lastVowel(stem) == 'ㅡ' && /[ㅏㅑㅗㅛ]/.test(lastVowel(stem.substring(0, stem.length - 1)))) {
                        trueMorphs.push(morph)
                    }
                    break;
                case '어':
                    if (/[ㅓㅕㅜㅠㅣ]/.test(lastVowel(stem))) {
                        trueMorphs.push(morph)
                    }
                    if (lastVowel(stem) == 'ㅡ' && /[ㅓㅕㅜㅠㅣ]/.test(lastVowel(stem.substring(0, stem.length - 1)))) {
                        trueMorphs.push(morph)
                    }
                    break;
                default:
                    trueMorphs.push(morph)
                    break;
            }
        }
    }
    return trueMorphs;
}

